import React from 'react';
import './grid-image.styles.css';
import Intro from "../../assets/saveur de génie.jpg";



function PhotoGallery(){
    return(
        <div className="photo-grid">
            <div className='card'
            style={{backgroundImage: `url(${Intro})`}}>1
            </div>
            <div className='card'
            style={{backgroundImage:`url($("../../assets/brasse ta fac!.png"))`}}>2
            </div>
            <div className='card'
            style={{backgroundImage:`url($("../../assets/SHerbroue-projet.jpg"))`}}>3
            </div>
        </div>
    )
}

export default PhotoGallery;
